import React from "react";
import Heading from "../components/Heading";
import { featured1 } from "../assets/images/products";
import ProductCard from "../components/ProductCard";
import { DeleteIcon, ShoppingCartOutlinedIcon } from "../assets/icons";

const WishPage = () => {
  return (
    <section className="max-container my-10 bg-orange-200 p-2">
      <Heading title={"Wishlist"} heading={"Wishlist (4)"} />
      <div className="grid grid-cols-6">
        <div className="max-h-80">
          <div className="flex flex-col items-center">
            <div className="max-h-56">
            <img src={featured1} alt="" className="" />
            <DeleteIcon />
            </div>
            <div className="bg-orange-500 w-full flex justify-center p-1">
              <ShoppingCartOutlinedIcon className="text-white" />
              <h1 className="text-white font-semibold">Add to cart</h1>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default WishPage;
